import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import "./Login.css";

export default function RoleBasedLogin() {
  const [role, setRole] = useState("customer"); // Default role
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [errorMessage, setErrorMessage] = useState("");
  const navigate = useNavigate();

  const handleLogin = async () => {
    setErrorMessage("");

    if (!email.trim() || !password.trim()) {
      setErrorMessage("Please fill out both fields!");
      return;
    }

    try {
      const loginData = { email, password };
      const apiUrl =
        role === "customer"
          ? "http://localhost:8085/api/farmers/login"
          : "http://localhost:8085/api/employee/login";

      const response = await axios.post(apiUrl, loginData);

      if (response.status === 200) {
        const userId = response.data.id;
        const storageKey = role === "customer" ? "userId" : "employeeId";

        localStorage.setItem(storageKey, userId);

        alert("Login successful!");
        const dashboardPath =
          role === "customer" ? "/custheader/dashboard" : "/empdash/dashboard";
        navigate(dashboardPath);
      } else {
        setErrorMessage("Invalid email or password.");
      }
    } catch (error) {
      setErrorMessage(
        error.response?.data?.message || "Error while logging in. Please try again later."
      );
      console.error(error);
    }
  };

  return (
    <div className="unique-login-page">
      <div className="unique-login-container">
        <div className="unique-form-container">
          <Link to="/loginc" className="signup-link">
            Back
          </Link>
          <h2 className="unique-form-title">Sign In</h2>
          <form
            className="unique-form unique-signin-form"
            onSubmit={(e) => e.preventDefault()}
          >
            <div className="unique-form-group">
              <label htmlFor="role">Select Role</label>
              <select
                className="unique-form-input"
                value={role}
                onChange={(e) => setRole(e.target.value)}
              >
                <option value="customer">Customer</option>
                <option value="employee">Employee</option>
              </select>
            </div>

            <div className="unique-form-group">
              <label>Email</label>
              <input
                className="unique-form-input"
                type="email"
                placeholder="Enter your email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>
            <div className="unique-form-group">
              <label>Password</label>
              <input
                className="unique-form-input"
                type="password"
                placeholder="Enter your password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </div>

            {errorMessage && <p className="error-message">{errorMessage}</p>}

            <button
              type="button"
              className="unique-form-submit-button"
              onClick={handleLogin}
            >
              Sign In
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}
